import {AppInitialProps, AppProps, Container} from "next/app";
import * as React from "react";

interface BaseProps extends AppInitialProps, AppProps {}

class App {

    static async getInitialProps({ Component, pageProps }: BaseProps) {
        return <Component {...pageProps} />;
    }

    render() {
        return (
            <Container>

            </Container>
        );
    }
}
